import React from 'react';
import logo0 from '../images/pands.png';
import './header.scss';

const header = () => { 
    return(
        <div className="Banner">
            <img className="Logo" src={logo0}></img>
            <div className="Navbar">
                <ul>
                    <li>Strona główna</li>
                    <li>Firma</li>
                    <li>Oferta</li>
                    <li>Usługi</li>
                    <li>Katalog</li>
                    <li>Zamówienia</li>
                    <li>Konatkt</li>
                </ul>
            </div>
            <div>
                <p>TO TU</p>
            </div>
        </div>
    );
}

export default header;
